import React, { Component } from 'react';

class ProgressComponentItem extends Component {
  render() {
    return (
      <div className="progress-item">
        <span className="progress-title">{this.props.title}</span>
        <div className="progress">
           <div style={{width:'62%'}} className="progress-bar" role="progressbar" aria-valuenow="62" aria-valuemin="0" aria-valuemax="100">
              <span className="progress-percent"> 62%</span>
           </div>
        </div>
     </div>
    )
  } 
}

class ProgressComponent extends Component {
  render() {
    return (
      <div className="progress-wrapper">
         <ProgressComponentItem title={"FRONT END"} porcentage={62}  />
         <ProgressComponentItem title={"BACK END"} porcentage={62}  />
         <ProgressComponentItem title={"WRITING"} porcentage={62}  />
      </div>
    );
  }
}

export default ProgressComponent;
